const Model = () => {
  return (
    <div className='w-full h-[100vh] fixed bg-black bg-opacity-50 text-black top-0 left-0 flex justify-center'>
    <div className='w-1/2 bg-white rounded-lg h-fit mt-32' >
      this is model
